import React, { useState } from 'react';
import '../../App.css';
import ''

function Nav() {
  const [isHiddenDiv1Visible, setIsHiddenDiv1Visible] = useState(false);
  const [isHiddenDiv2Visible, setIsHiddenDiv2Visible] = useState(false);

  const toggleHiddenDiv1 = () => {
    setIsHiddenDiv1Visible(!isHiddenDiv1Visible);
  };

  const toggleHiddenDiv2 = () => {
    setIsHiddenDiv2Visible(!isHiddenDiv2Visible);
  };

  return (
    <div>
      <nav id="nav">
        <button class="nav_link" id="toggleButton1" onClick={toggleHiddenDiv1}>Кафедра</button>
        <button class="nav_link" id="toggleButton2" onClick={toggleHiddenDiv2}>Багыттары</button>
        <button class="nav_link">Жанылыктар</button>
        <button class="nav_link">Иш-чаралар</button>
        <button class="nav_link">Байланыш үчүн</button>
      </nav>
      {isHiddenDiv1Visible && (
        <div id="hiddenDiv1">
          <div class="container">
            <div class="togged_kafedra">
              <div class="part1">
                Кафедра
              </div>
              <div class="part2">
                <ul>
                  <li><a href="">Тарыхы</a></li>
                  <li><a href="">Курамы</a></li>
                  <li><a href="">Аккредитация</a></li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      )}
      {isHiddenDiv2Visible && (
        <div id="hiddenDiv2">
          <div class="container">
            <div class="togged_bagytary">
              <div class="part1">
                багыттар жана профилдер
              </div>
              <div class="part2">
                <ul>
                  <li><a href="">Графика</a> </li>
                  <li><a href="">Информатика жана Эсептөө техникасы</a></li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default Nav;
